import React from 'react';
import './App.css';

function App() {
  con
  function getHashParams() {
    var hashParams = {};
    var e, r = /([^&;=]+)=?([^&;]*)/g,
      q = window.location.hash.substring(1);
    while (e = r.exec(q)) {
      hashParams[e[1]] = decodeURIComponent(e[2]);
    }
    return hashParams;

  }
  return (
    <div className="App">
      <a href="http://localhost:8888">
        <button>Login with Spotify</button>
      </a>
    </div>
  );
}

export default App;
